     hsl.x -= 1.0; // Hue\r\n  }\r\n\r\n  return clamp(hsl,0.0,1.0);\r\n}\r\n\r\nfloat HueToRGB(float f1, float f2, float hue)\r\n{\r\n  if (hue < 0.0)\r\n    hue += 1.0;\r\n  else if (hue > 1.0)\r\n    hue -= 1.0;\r\n  float res;\r\n  if ((6.0 * hue) < 1.0)\r\n    res = f1 + (f2 - f1) * 6.0 * hue;\r\n  else if ((2.0 * hue) < 1.0)\r\n    res = f2;\r\n  else if ((3.0 * hue) < 2.0)\r\n    res = f1 + (f2 - f1) * ((2.0 / 3.0) - hue) * 6.0;\r\n  else\r\n    res = f1;\r\n  return res;\r\n}\r\n\r\nvec3 HSLToRGB(vec3 hsl)\r\n{\r\n  vec3 rgb;\r\n  \r\n  if (hsl.y == 0.0)\r\n    rgb = vec3(hsl.z); // Luminance\r\n  else\r\n  {\r\n    float f2;\r\n    \r\n    if (hsl.z < 0.5)\r\n      f2 = hsl.z * (1.0 + hsl.y);\r\n    else\r\n      f2 = (hsl.z + hsl.y) - (hsl.y * hsl.z);\r\n      \r\n    float f1 = 2.0 * hsl.z - f2;\r\n    \r\n    rgb.r = HueToRGB(f1, f2, hsl.x + (1.0/3.0));\r\n    rgb.g = HueToRGB(f1, f2, hsl.x);\r\n    rgb.b = HueToRGB(f1, f2, hsl.x - (1.0/3.0));\r\n  }\r\n  \r\n  return rgb;\r\n}\r\n\r\nfloat Lum(vec3 c){\r\n  return 0.299*c.r + 0.587*c.g + 0.114*c.b;\r\n}\r\n\r\nvec3 ClipColor(vec3 c){\r\n  float l = Lum(c);\r\n  float n = min(min(c.r, c.g), c.b);\r\n  float x = max(max(c.r, c.g), c.b);\r\n\r\n  if (n < 0.0) c = (c-l)*l / (l-n) + l;\r\n  if (x > 1.0) c = (c-l) * (1.0-l) / (x-l) + l;\r\n  \r\n  return c;\r\n}\r\n\r\nvec3 SetLum(vec3 c, float l){\r\n  float d = l - Lum(c);\r\n\r\n  c.r = c.r + d;\r\n  c.g = c.g + d;\r\n  c.b = c.b + d;\r\n  \r\n  return ClipColor(c);\r\n}\r\n\r\nvoid main() {\r\n\r\n  vec3 color = texture2D(texture, coord.xy).rgb;\r\n  vec3 hsl = RGBToHSL(color);\r\n  vec3 hslMap = texture2D(map, vec2(hsl.x)).xyz;\r\n\r\n    vec3 rgb = HSLToRGB(vec3(\r\n      hsl.x - ((1.0 - hslMap.x*2.0)*60.0)/360.0,\r\n      hsl.y * (hslMap.y*2.0),\r\n      hsl.z// + (hslMap.z - 0.5)*hsl.y*0.5\r\n    ));\r\n\r\n    float lum = Lum(color);\r\n    rgb = SetLum(rgb, lum + (hslMap.z - 0.5) * (hsl.y*(1.0-lum)*4.0) * lum*lum);\r\n\r\n  gl_FragColor = vec4(rgb, 